import React from "react";

function ProfileSteffen(props: any) {
  return (
    <svg
      width={128}
      height={128}
      viewBox="0 0 200 200"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      {...props}
    >
      <rect width={200} height={200} rx={100} fill="url(#prefix__pattern0)" />
      <defs>
        <pattern
          id="prefix__pattern0"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}
        >
          <use xlinkHref="#prefix__image0" transform="scale(.005)" />
        </pattern>
        <image
          id="prefix__image0"
          width={200}
          height={200}
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
}

export default ProfileSteffen;
